import './App.css';
import {BrowserRouter,Router,Route} from 'react-router-dom';
import Signup from './components/signup';
const Routing = ()=>{
  return (
      <Route exact path="/" >
        <Signup />
      </Route>
  )
}

function App() {
  return (
    <BrowserRouter>
      <Router>
        <Routing />
      </Router>
    </BrowserRouter>
  );
}

export default App;
